import "./App.css";
import Header from "./MyComponents/Header";  //default import  **
import { Todos } from "./MyComponents/Todos";
import { Footer } from "./MyComponents/Footer";

function App() {
  let todos = [
    {
      sno: 1,
      title: "Go to school",
      desc: "Get this job done first"
    },
    {
      sno: 2,
      title: "Go to college",
      desc: "Get this job done second"
    },
    {
      sno: 3,
      title: "Go to work",
      desc: "Get this job done third"
    }
  ]
  return (
    <>
      <Header title="My Todos List" />
      <Todos todos={todos} />
      <Footer />
    </>
  );
}

export default App;
